int minOperations(int* nums, int numsSize, int k) {
    // Counter array to keep track of numbers from 1 to k.
    int count[k];
    for (int i = 0; i < k; i++) {
        count[i] = 0;
    }

    // Variable to keep track of how many unique numbers from 1 to k we have seen.
    int uniqueNumbers = 0;

    // Iterate over the array from the end towards the beginning.
    for (int i = numsSize - 1; i >= 0; i--) {
        // If the current number is within our target range (1 to k) and we haven't seen it before.
        if (nums[i] <= k && count[nums[i] - 1] == 0) {
            // Mark this number as seen.
            count[nums[i] - 1] = 1;
            // Increment the count of unique numbers seen.
            uniqueNumbers++;
        }

        // If we have seen all numbers from 1 to k, break the loop.
        if (uniqueNumbers == k) {
            // Return the number of operations needed, which is the length of the array minus the current index.
            return numsSize - i;
        }
    }

    // In case something goes wrong, which shouldn't happen given the problem's constraints.
    return -1;
}
